class Human:    passclass Jurnal:    def __init__(self):        self.__jurnal = [2, 3, 5, 4, 2]    def append_baho(self, grade):        self.__jurnal.extend(grade)    def show(self):        print(self.__jurnal)class Teacher(Human):    def __init__(self, grade1):        self.grade_put = grade1    def append_baholar(self, obj):        obj.append_baho(self.grade_put)class Student(Human):    def show_baholar(self, obj):        obj.show()jurnal = Jurnal()Teshaboy = Teacher([2, 3, 4])Teshaboy.append_baholar(jurnal)Boborahim = Student()Boborahim.show_baholar(jurnal)